    false,nt"url": null,nt"notes": "The EnviroAtlas Woodbine, IA land cover
    (LC) data and map were generated from USDA NAIP (National Agricultural Imagery Program)
    four band (red, green, blue and near infrared) aerial photography from Late Summer
    2011 at 1 m spatial resolution. Six land cover classes were mapped: water, impervious
    surfaces (dark and light), soil and barren land, trees and forest, grass and herbaceous
    non-woody vegetation, and agriculture. An accuracy assessment using a completely
    random sampling of 600 samples yielded an overall accuracy of 87.03% percent using
    a minimum mapping unit of 9 pixels (3x3 pixel window). The area mapped is defined
    by the US Census Bureau's 2010 Urban Statistical Area for Woodbine. This dataset
    was produced by the US EPA to support research and online mapping activities related
    to EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas) allows the user to
    interact with a web-based, easy-to-use, mapping application to view and analyze
    multiple ecosystem services for the contiguous United States. The dataset is available
    as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas) or as an
    EnviroAtlas map service. Additional descriptive information about each attribute
    in this dataset can be found in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).",nt"license_title":
